import React, {Component} from 'react'
import ReactDom from 'react-dom';
import './BoxHeader.css';
import BoxHeaderLogo from '../logo.png';
import BoxHeaderButton from './BoxHeaderButton';
import WaiterButton from './WaiterButton';
import Kitchen from './Kitchen';

class BoxHeader extends Component {
  WaiterButton (){
    ReactDom.render(<WaiterButton/>, document.getElementById('containerMenu'))
  }
  Kitchen (){
    ReactDom.render(<Kitchen/>, document.getElementById('containerMenu'))
  }

  render () {
    return (
      <div>
    <div className= "BoxHeader">
      <img src={BoxHeaderLogo} className = "BoxHeaderLogo" alt="logo"/>
      <button className ="BoxHeaderButton"> <BoxHeaderButton rol = "Meser@" customOnButtonClick ={this.WaiterButton}/></button>
      <button className ="BoxHeaderButton"> <BoxHeaderButton rol = "Cocina"customOnButtonClick ={this.Kitchen}/></button>
    </div>
    <div id="containerMenu"></div>
    </div>

    );
  }
}

export default BoxHeader;
